import { useState } from "react";

const UserForm = () => {
    const {name, setName} = useState('')
    const {email, setEmail} = useState('')

    return(
        <form>
            <div>
                <label>Name</label>
                <input value={name} onChange={setName(e => e.target.value)}/>
            </div>
            <div>
                <label>Email</label>
                <input value={email} onChange={setEmail(e => e.target.value)}/>
            </div>
            <button>Add User</button>
        </form>
    )
}

export default UserForm;
